[application]

name="Hell Boat"
main_scene="res://scenes/ui/main_menu.xml"
icon="icon.png"
boot_logo=img(rgba, 0, 800, 600, )

[autoload]

application="res://src/application.gd"

[display]

stretch_mode="viewport"
stretch_aspect="keep"
width=800
height=600
resizable=true

[input]

ui_accept=[key(Return), key(Enter), key(Space), jbutton(0, 0)]
ui_left=[key(Left), jbutton(0, 14)]
ui_right=[key(Right), jbutton(0, 15)]
win=[key(W)]
lose=[key(L)]
save=[key(S)]
reset=[key(R)]

[physics_2d]

default_gravity=98
